import React, { Fragment } from 'react'
import { TextField } from '@shopify/polaris';

const Question = () => {
    return (
        <Fragment>
            <TextField
                value={url}
                onChange={handleUrlChange}
                label="Question"
                type="text"
                placeholder="Which of the following do you prefer, etc"
            />
            <TextField
                value={url}
                onChange={handleUrlChange}
                label="Option 1"
                type="text"
                placeholder="Which of the following do you prefer, etc"
            />
            <TextField
                value={url}
                onChange={handleUrlChange}
                label="Option 2"
                type="text"
                placeholder="Which of the following do you prefer, etc"
            />
            <TextField
                value={url}
                onChange={handleUrlChange}
                label="Option 3"
                type="text"
                placeholder="Which of the following do you prefer, etc"
            />
            <TextField
                value={url}
                onChange={handleUrlChange}
                label="Option 4"
                type="text"
                placeholder="Which of the following do you prefer, etc"
            />
        </Fragment>
    )
}

export default Question;
